(1, 4, 11, 'nnnnnnnnnnnnnnnnnnnnnnnnnn', '30-06-2021'),
(2, 1, 11, 'Polycystic ovary syndrome (PCOS) is a condition that affects a woman’s hormone levels.\r\n\r\nWomen with PCOS produce higher-than-normal amounts of male hormones. This hormone imbalance causes their body to skip menstrual periods and makes it harder for them to get pregnant.', '01-07-2021'),
(3, 1, 11, 'No Idea', '01-07-2021'),
(4, 5, 2, 'Most women with breast cancer have some type of surgery. Common types of breast surgery are lumpectomy, mastectomy, and taking out lymph nodes from the underarm. Women who have a mastectomy may also decide to have the breast shape rebuilt, either at the same time or later on', '04-07-2021 (Sun) 21:32:39'),
(5, 1, 19, 'PCOS affects a woman’s ovaries, the reproductive organs that produce estrogen and progesterone — hormones that regulate the menstrual cycle. The ovaries also produce a small amount of male hormones called androgens.', '04-07-2021 (Sun) 21:59:36'),
(6, 3, 8, 'On average, the caloric expenditure per 100 pounds of body weight per mile is 62 calories. So if a person weighs 200 pounds, they would burn approximately 124 calories while walking or jogging.', '04-07-2021 (Sun) 22:05:45');

