INSERT INTO `event_details` (`EventID`, `EventName`, `EventDate`, `EventTime`, `EventCategory`, `EventDescription`, `EventTicketPrice`, `EventTicketTotal`, `EventTicketSold`, `VenueID`, `UserID`, `EventPrerequisite`, `EventImageLink`, `EventDuration`) VALUES
(1, 'What Should I eat ?', '2019-08-31', '08:00:00', 'Diet', 'The average person needs about 2,000 calories every day to maintain their weight, but the amount will depend on their age, sex, and physical activity level. Males tend to need more calories than females, and people who exercise need more calories than people who don\'t.', 5, 100, 3, 2, 'AUTAR002', 'No', 'images/img4.jpg', 2),
(2, 'Movie Night: Aladdin 2019', '2019-08-18', '22:00:00', 'Movie, Gathering', 'Aladdin is a lovable street urchin who meets Princess Jasmine, the beautiful daughter of the sultan of Agrabah. While visiting her exotic palace, Aladdin stumbles upon a magic oil lamp that unleashes a powerful, wisecracking, larger-than-life genie. As Aladdin and the genie start to become friends, they must soon embark on a dangerous mission to stop the evil sorcerer Jafar from overthrowing young Jasmine\'s kingdom.', 16, 300, 4, 3, 'AUTAR001', 'NO', 'images/img2.jpg', 1),
(3, 'Personalizing Ovaries : Knowing your Genetics ', '2021-07-14', '09:30:00', 'Fertility Issues', 'We will be presenting a live-streaming event to discuss state-of-the-art treatments for ovarian cancer and what’s different about hereditary ovarian cancer. We will be discussing indications for genetic testing, the role of tumor molecular profiling in improving the survival for patients and their families, and targeted therapeutic options including PARP inhibitors, immunotherapy and clinical trials.', 50, 20, 2, 5, 'AUTAR001', 'No', 'images/img2.jpg', 2),
(4, 'Balance Diet', '2019-08-24', '10:00:00', 'Diet', 'A balanced diet is a diet that contains differing kinds of foods in certain quantities and proportions so that the requirement for calories, proteins, minerals, vitamins and alternative nutrients is adequate and a small provision is reserved for additional nutrients to endure the short length of leanness.', 12, 500, 3, 1, 'AUTAR002', 'No', 'images/img5.jpg', 3),
(5, 'Informational Webinar on bariatric Weight-Loss Surgery.\r\n', '2021-12-10', '21:00:00', 'Exercise and Fitness', 'We will be presenting a live-streaming webinar to discuss an overview of prenatal care and what every pregnant woman should know as she creates a new life. We will discuss the role of immunization and how to stay healthy during pregnancy.\r\n', 150, 100, 6, 6, 'AUTAR001', 'No', 'images/img7.jpg', 4),
(6, 'MoonDance @ SkySymphony', '2019-08-10', '00:30:00', 'Festival', '3, 2, 1â€¦ and blast off! To the moon goes Gentingâ€™s Highland Heroes! Joined by adorable Moon Bunnies, be immersed in an epic outer space dance party, where stunning visuals are paired with catchy tunes and dynamic winch balls for an upbeat, show-stopping performance. \r\n\r\nShow runs every half an hour.', 0, 10000, 3, 7, 'AUTAR005', 'No', 'images/img2.jpg', 3),
(7, 'Public awareness of PCOS', '2021-07-15', '13:00:00', 'Reproductive Health', 'Public awareness of PCOS is necessary because over half of the 10,000,000 people that have it, are unaware of it.\r\n\r\nAwareness helps the public understand that symptoms like irregular periods and pelvic pain are not something to be ignored and getting it checked is necessary. While there is no cure for PCOS, there are treatments that can help ease the stress and complications of specific symptoms. The more people that are informed of PCOS the better chances for early diagnosis.', 16, 30, 5, 3, 'AUTAR001', 'Ready to learn', 'images/img3.jpg', 2),
(8, 'What is the best treatment for uterine fibroids?', '2021-07-23', '08:59:26', 'Reproductive Health', 'A myomectomy is an operation to remove fibroids while preserving the uterus. For women who have fibroid symptoms and want to have children in the future, myomectomy is the best treatment option. Myomectomy is very effective, but fibroids can re-grow.', 0, 100, 0, 7, 'Martin4301', 'no', 'images/img6.jpg', 2);

